import React from "react";
import { Typography, TextField } from "@material-ui/core";

const SignUpPage = () => {
	return (
		<div>
			<Typography>Sign Up</Typography>
			<form>
				<TextField required id="firstName" label="First Name" />
			</form>
		</div>
	);
};

export default SignUpPage;
